List<int> arr = dd.TrimEnd().Split(' ').ToList().Select(arrTemp => Convert.ToInt32(arrTemp)).ToList();

List<typeCount> lst = new List<typeCount>();

for (int i = 0; i < arr.Count; i++)
{
    if (lst.Any(c => c.type == arr[i]))
    {
        var item = lst.Where(c => c.type == arr[i]).FirstOrDefault();
        if (item != null) item.count++;
    }
    else
    {
        lst.Add(new typeCount { type = arr[i], count = 1 });
    }
}

var type = 0;
var max = 0;
for (int i = 0; i < lst.Count; i++)
{
    if (lst[i].count > max && lst[i].count > 1)
    {
        max = lst[i].count;
        type = lst[i].type;
    }
    else if (lst[i].count == max && lst[i].type < type)
    {
        max = lst[i].count;
        type = lst[i].type;
    }
}

Console.WriteLine($"type={type} and max={max}");


class typeCount
{
    public int type { get; set; }
    public int count { get; set; }
}